import React from 'react'
import './Cart.scss'

const Cart = () => {

    const data = [
        {
            id: 1,
            img: "",
            img2: "",
            title: "Long Sleeve Graphic T-shirt",
            isNew: true,
            oldPrice: 19,
            price: 12,
        },
        {
            id: 2,
            img: "",
            title: "Coat",
            isNew: true,
            oldPrice: 19,
            price: 12,
        },
    ];

  return (
    <div className='cart'>
        <h1>Products in your cart</h1>
        {data?.map(item=>(
            <div className="item" key={item.id}>
                <img src="{item.img}" alt="" />
                <div className="details">
                    <h1>{item.title}</h1>
                    <p>{item.desc}</p>
                </div>
            </div>
        ))}
    </div>
  )
}

export default Cart
